import React from 'react';
import './AboutUs.css';

class Aboutus extends React.Component{

    render() {
        return <div id="main">
            <div id="header-text"><b>About Image2Text</b></div>
            <div id="about-text">
                <p>
                    Image2Text provides you the convenience to extract text, URLs and detect languages in an image.
                </p>
                <p>
                    It makes use of tesseract engine which is an opensource OCR library to extract text data from an image.
                </p>
            </div>
        </div>
    }
}

export default Aboutus;
